import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";

function App() {
  function Entry(emojis) {

    return <Entry
      Key={emojis.id}
      name={emojis.name}
      emoji={emojis.emoji}
      meaning={emojis.meaning}
    />

  }
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      emojipedia.map(Entry);
    </div>
  );
}

export default App;
